var title_f20_20_20811="Signs and symptoms of spinal cord injury";
var content_f20_20_20811=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F76379&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=12\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F76379&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=12\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Symptoms and signs of traumatic cervical spinal cord injury",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Altered mental status",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abnormal motor examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abnormal sensory examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Abnormal or absent reflexes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Paralysis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neck pain at rest or with isometric neck motion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Decreased cervical range of motion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Posterior midline cervical tenderness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Muscle spasm of cervical muscles",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bilateral symptoms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lower extremity symptoms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypotension with bradycardia (neurogenic shock)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Diaphragmatic breathing without retractions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Autonomic hyperreflexia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypothermia or hyperthermia",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
