var title_f20_20_20812="Host factors and meningitis";
var content_f20_20_20812=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F72293&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F72293&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Host immune defects predisposing to meningitis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Host problem",
"       </td>",
"       <td class=\"subtitle1\">",
"        Organism favored",
"       </td>",
"       <td class=\"subtitle1\">",
"        Frequency of defect actually leading to infection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Absence of opsonizing antibody",
"       </td>",
"       <td>",
"        <em>",
"         Streptococcus pneumoniae",
"        </em>",
"       </td>",
"       <td>",
"        Common in all age groups",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <em>",
"         Haemophilus influenzae",
"        </em>",
"       </td>",
"       <td>",
"        Common in very young children",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Asplenia: surgical or functional",
"       </td>",
"       <td>",
"        <em>",
"         S. pneumoniae",
"        </em>",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <em>",
"         Neisseria meningitidis",
"        </em>",
"       </td>",
"       <td>",
"        Very rare",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Complement deficiency",
"       </td>",
"       <td>",
"        <em>",
"         N. meningitidis",
"        </em>",
"       </td>",
"       <td>",
"        Very rare",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Glucocorticoid excess",
"       </td>",
"       <td>",
"        <em>",
"         Listeria monocytogenes",
"        </em>",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <em>",
"         Cryptococcus neoformans",
"        </em>",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        HIV infection",
"       </td>",
"       <td>",
"        <em>",
"         C. neoformans",
"        </em>",
"       </td>",
"       <td>",
"        About 5 percent eventually get cryptococcal meningitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <em>",
"         S. pneumoniae",
"        </em>",
"       </td>",
"       <td>",
"        Common presenting illness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <em>",
"         L. monocytogenes",
"        </em>",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Bacteremia/endocarditis",
"       </td>",
"       <td>",
"        <em>",
"         Staphylococcus aureus",
"        </em>",
"        ; various gram-negative rods",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Basilar skull fracture",
"       </td>",
"       <td>",
"        <em>",
"         S. pneumoniae",
"        </em>",
"        ; other upper respiratory tract flora",
"       </td>",
"       <td>",
"        Very rare",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
